import React from "react";
import "./style.css";
const Signup = () => {
  return (
    <>
      <div className="container">
        <div>
          <h2>Library Management System</h2>
        </div>

        <div>

          <div>
            <label>Name</label>
            <input type="text" />
          </div>
          <div>
            <label>Email</label>
            <input type="text" />
          </div>
          <div>
            <label>Password</label>
            <input type="text" />
          </div>

        </div>

      </div>
    </>
  );
};

export default Signup;
